import { createDrawerNavigator } from "@react-navigation/drawer";
import { NavigationContainer } from "@react-navigation/native";
import { Button, View } from "react-native";
import MessagesScreen from './MessagesScreen.js'; // 导入 MessagesScreen
import NewScreen from './WeatherScreen.js'; // NewScreen
import RabbitScreen from './MoodColor.js'; // NewScreen

function HomeScreen({ navigation }) {
  return (
    <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
      <Button onPress={navigation.openDrawer} title="Open navigation drawer" />
      <Button
        onPress={() => navigation.navigate('Notifications')}
        title="Go to notifications"
      />
    </View>
  );
}

const Drawer = createDrawerNavigator();

export default function App() {
  return (
    <NavigationContainer>
      <Drawer.Navigator initialRouteName="Home">
        <Drawer.Screen name="Home" component={HomeScreen} />
        <Drawer.Screen name="Message to Fife Rabbits" component={MessagesScreen} />
        <Drawer.Screen name="Fife Rabbit Letters" component={RabbitScreen} />
        <Drawer.Screen name="MoodC" component={NewScreen} />
      </Drawer.Navigator>
    </NavigationContainer>
  );
}
